import React from 'react';
import dog from './dog.png';

const Boxes = ({ name }) => {
	return (
		<div className="black f4">
			{`${name}, pick your favorite pet and fill out an application`}
			<div className='tc bg-white h-1 w-1 dib br3 pa3 ma2 grow bw2 shadow5'>
				<img alt='golden retriever' src={dog} />
					<div>
			  			<h2>Nensi</h2>
			  			<p>Golden Retriever</p>
				</div>
			</div>
		</div>
	);
}

export default Boxes;
